import React from 'react';
import BlogCart from './BlogCart';
import s from './Blogs.module.css';

const Blogs = (props) => {

    let carts =
        props.carts.map(c => <BlogCart title={c.title}
            description={c.description} />)

    return (
        <div className={s.body}>
            {carts}
        </div>
    );
}

export default Blogs;
